import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';
import img from './doc.jpg';
// import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col' 
import Container from 'react-bootstrap/Container'
import { AiOutlineInstagram , AiOutlineFacebook} from "react-icons/ai";      

const useStyles = makeStyles((theme) => ({
    large: {
      width: theme.spacing(25),
      height: theme.spacing(25),
    },
  }));

function Home() {
  const classes = useStyles();
  return (
    <Container style={{}}>

        <Col>
            <Row>
            {/* <Avatar alt="Dr. Bharath Kumar" className={classes.large} src={img} style={{top:"150px", position:"absolute"}}/> */}
            <img src={img}  width="300" height="300"  style={{verticalAlign:"top", position:"center", marginTop:"100px"}}/>
            </Row>
            <Row>
                <Typography variant="h3"  gutterBottom>
                    DR. BHARATH KUMAR B

                </Typography>
                <Typography variant="h5"  gutterBottom>
                    MBBS, PGDSM (Sports Medicine)
                </Typography>
            </Row>
            <Row>
            <AiOutlineInstagram size="40"/>
            <AiOutlineInstagram size="40"/>
            <AiOutlineInstagram size="40"/>
            <AiOutlineInstagram size="40"/>
                {/* <Col><AiOutlineInstagram size="40"/></Col>
                <Col><AiOutlineFacebook size="40"/></Col>
                <Col><AiOutlineInstagram size="40"/></Col>
                <Col><AiOutlineInstagram size="40"/></Col> */}
            </Row>
        </Col>


    </Container>    
  );
}

export default Home;
